import React from "react";
import Button from "./Button";

import { Link } from "react-router-dom";

const Home = () => {
    return (
        <main className="homePage">
            <section id="home">
                <h1 id="title">WE MADE YOUR MEDICAL TREATMENT EASY</h1>
                <p id="para">
                    Start an instant consultation within 2 minutes or do video
                    consultation at the scheduled time.
                </p>

                <div className="option">
                    <span>Register as a:&emsp;</span>
                    <Link to={"/organization"}>
                        <Button
                            className="homeBtn"
                            buttonText={"Organization"}
                        />
                    </Link>
                    &emsp;
                    <Link to={"/patient"}>
                        <Button className="homeBtn" buttonText={"Patient"} />
                    </Link>
                    &emsp;
                    <Link to={"/doctor"}>
                        <Button className="homeBtn" buttonText={"Doctor"} />
                    </Link>
                </div>
            </section>
        </main>
    );
};

export default Home;
